import React from 'react';
import Nav from 'react-bootstrap/Nav';
import Container from 'react-bootstrap/Container';
import Button from 'react-bootstrap/Button';
import NavDropdown from 'react-bootstrap/NavDropdown';



class Nav1 extends React.Component {
	render(){
		console.log(Nav);
		return(
			<Nav className="navbar navbar-expand-lg navbar-dark ftco_navbar bg-dark ftco-navbar-light">
				<Container>
					<Nav.Item >
						<Nav.Link className="navbar-brand">Komerz.io</Nav.Link>
					</Nav.Item>
					<Button className="navbar-toggler" type="button" data-toggle="collapse" data-target="#ftco-nav" aria-controls="ftco-nav" aria-expanded="false" aria-label="Toggle navigation">
						<span className="oi oi-menu"></span>
    					Menu	
					</Button>
					<Container className="collapse navbar-collapse">
						<NavDropdown title="Dropdown" id="nav-dropdown">
        				<NavDropdown.Item eventKey="4.1">Action</NavDropdown.Item>
        				<NavDropdown.Item eventKey="4.2">Another action</NavDropdown.Item>
        				<NavDropdown.Item eventKey="4.3">Something else here</NavDropdown.Item>
        				<NavDropdown.Divider />
        				<NavDropdown.Item eventKey="4.4">Separated link</NavDropdown.Item>
     	 				</NavDropdown>
					</Container>
				</Container>
			</Nav>
		)

	}
}
export default Nav1;
